import React from "react";

function Component2() {
  return (
    <div className="w-full text-center py-16 px-4">
      <h1 className="text-2xl md:text-4xl font-bold mt-5">
        Visualize Your Journey
      </h1>
      <p className="text-sm md:text-base text-gray-700 mt-3 max-w-2xl mx-auto">
        See your habits come together in a beautiful, GitHub-inspired
        visualization. Track multiple habits at once and pin your most important
        ones for quick access and focused tracking.
      </p>
      <button className="mt-6 w-[200px] h-[45px] rounded-lg bg-[#1976d2] text-white text-base font-medium hover:bg-[#176cc1] transition">
        Start Your Journey
      </button>
    </div>
  );
}

export default Component2;
